import React from 'react'
import styled from 'styled-components'
import { Flex as GridFlex, Box as GridBox } from '@rebass/grid'
import {height, flex} from 'styled-system'

export const Flex = styled(GridFlex)`
  ${height}
  ${flex}
  ${props => props.fill && `flex: 1;`}
`

export const Div = (props) => <GridBox {...props} />
export const Column = (props) => <Flex flexDirection="column"  {...props} />

export const Row = (props) => <Flex flexWrap="wrap" mx={-15} {...props} />
export const Cell = (props) => <GridBox px={15} {...props} />

export const Box = styled(Div)`
  background-color: white;
  border-radius: 2px;
  ${props => props.theme.shadow}
`

export const Container = (props) => <Div m="0 auto" px={10} py={20} width={1000} {...props} />
